export function getLabelByCode(list: OptionItem[], code: string | undefined | null): string {
  if(!code) return "";

  const found = list.find(item => item.code === code);
  return found?.label ?? code;
}


export interface OptionItem {
  label?: string;
  code: string;
  note?: string;
  date?: string;
}

